		})
	},
	methods: {
		heatmapColor: function (views) {
			if (views > 90) {
				return 'fill-fuchsia-800 stroke-black dark:stroke-white'
			} else if (views >= 70) {
				return 'fill-fuchsia-700 stroke-black dark:stroke-white'
			} else if (views >= 50) {
				return 'fill-fuchsia-600 stroke-black dark:stroke-white'
			} else if (views >= 30) {
				return 'fill-fuchsia-500 stroke-black dark:stroke-white'
			} else if (views >= 10) {
				return 'fill-fuchsia-400 stroke-black dark:stroke-white'
			} else if (views >= 5) {
				return 'fill-fuchsia-300 stroke-black dark:stroke-white'
			} else {
				return 'fill-gray-200 dark:fill-gray-700 stroke-black dark:stroke-white'
			}
		},

	}
